import React, { Component } from "react";
import Layout from "../../components/Layout";
import Game from "../../components/Game";

class Theresume extends Component{
    
    render(){
        return(
            <Layout>
                <div className="container">
                    <div className="row d-flex justify-content-center">
                        <h1>The Resume Game</h1>
                        <div data-iframe="
                        <iframe mozallowfullscreen=&quot;true&quot; allow=&quot;autoplay; fullscreen; geolocation; microphone; camera; midi&quot; frameborder=&quot;0&quot; src=&quot;//v6p9d9t4.ssl.hwcdn.net/html/1692364/index.html?v=1574334917&quot; msallowfullscreen=&quot;true&quot; allowfullscreen=&quot;true&quot; webkitallowfullscreen=&quot;true&quot; id=&quot;game_drop&quot; allowtransparency=&quot;true&quot;></iframe>" class="iframe_placeholder"><button class="button load_iframe_btn"><svg stroke-linecap="round" stroke="currentColor" class="svgicon icon_play" role="img" version="1.1" viewBox="0 0 24 24" stroke-width="2" height="24" stroke-linejoin="round" aria-hidden="" fill="none" width="24"><circle cx="12" cy="12" r="10"></circle><polygon points="10 8 16 12 10 16 10 8"></polygon></svg> Run game</button></div>
                    </div>
                </div>                 
            </Layout>               
        )
    }
}

export default Theresume;
